import React from "react";

export default function App(props) {
  return (
    <div>
      {console.log(props.users.data)}
      {props.users.data
        ? props.users.map(user => {
            <ul>
              <li>{user.name.first}</li>
            </ul>;
          })
        : null}
    </div>
  );
}
